export default function Biens({getToken, Role, Id}) {
  const [val, setVal] = useState([]);
  const [loader, setLoader] = useState(true);
  const [hasError, setError] = useState(false);

  useEffect(() => {
    const getData = async () => {
      try {
        const res = await axios.get("/bien");
        console.log(res.data);
        setVal(res.data.reverse())
        setLoader(false);
      } catch (err) {
        console.error(err.response.data);
        setError(true);
      }
    };
    getData();
  }, []);

  if (loader) {
    return(
        <div className="center"><div className="lds-ellipsis"><div></div><div></div><div></div><div></div></div></div>
      )
  } else if (hasError) {
    return (
      <div className="error flex justify-center">
        Erreur lors du chargement
      </div>
    );
  } else {    
    return (
        <BiensCollection data={val} getToken={getToken} Role={Role} Id={Id}/>
      );
  }
}